  \"environmental-contaminants-in-fish-and-wildlife-of-havasu-national-wildlife-refuge-arizona\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Sediment, vegetation, clams, fish, waterbirds
  and waterbird eggs were collected at Havasu National Wildlife Refuge (NWR) during
  April-August 1993 for organochlorine compound and trace element analysis. Organochlorines
  were not detected in sediment or clams and only low levels of DDE were recovered
  in coot carcasses. Current residues of organochlorine compounds are low enough that
  even the most sensitive species of fish and wildlife are not likely to be affected.
  Elevated levels of several trace elements were detected throughout the Havasu NWR
  ecosystem. Arsenic in clams averaged about 2.5-times background levels. Cadmium
  and selenium concentrations also were elevated in clams to the point that wildlife
  feeding on clams may be adversely affected. Cadmium, copper, and lead in most fish
  samples exceeded background levels, but concentrations were below toxic thresholds.
  Selenium was the primary element of concern and bioaccumulation of selenium through
  the aquatic food chain was evident. Vegetation samples contained selenium concentrations
  that exceeded levels associated with food chain accumulation that can lead to reproductive
  failure in sensitive species of fish and avian herbivores. Selenium in four of five
  coot livers was higher than the normal or background range. Concentrations of selenium
  in eggs of western and Clark's grebes were two-to-four times the threshold level
  associated with toxic effects and embryo teratogenesis. Selenium was pervasive throughout
  the ecosystem, and levels were potentially high enough to adversely affect reproduction
  of fish and fish-eating birds.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
